import React from 'react'
import Slider from './Slider';

const Quesions = () => {
    const questions = [
        'What is your favorite color?',
        'What is the capital of France?',
        'How many continents are there in the world?'
      ];
    
      return (
        <div>
          <h1>Page Title</h1>
          <Slider questions={questions} />
        </div>
      );
}

export default Quesions
